('blog', 0, 2, 2, 'en', 0, '<p>This is not a drill: <em>Barbie</em> – the highest-grossing movie of 2023 and the most successful Warner Bros. movie of all time – is now streaming on Max.&nbsp;</p><p>If you somehow managed to miss the wall-to-wall coverage of Greta Gerwig\'s subversive satire over summer, this star-studded picture centers on an inquisitive Barbie doll (played by Margot Robbie) whose colorful and seemingly perfect existence is called into question following a trip to the (decidedly less perfect) real world. Ryan Gosling stars alongside Robbie as Ken, with Will Ferrell, Kate McKinnon, America Ferrera, Simu Liu, Emma Mackey and many, many more A-listers among the film\'s supporting cast.</p><p>Suffice to say, this is a big deal for Max subscribers, whose library of&nbsp;<a href=\"https://www.techradar.com/best/best-hbo-max-movies\">best Max movies</a>&nbsp;just got an envy-inducing upgrade. If you\'re in the UK viewers, you\'ll have to wait a little longer to stream <em>Barbie </em>from the comfort of your own Mojo Dojo Casa House, but we\'d expect to see the movie added to Sky Cinema soon.</p><p><em>Now available to stream on Max.</em></p>', '', 'basic_html'),
