INSERT INTO `node__body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `langcode`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('blog', 0, 1, 14, 'en', 0, 'It’s the final weekend before Christmas (yay!), but if you’re not ready to crack open the eggnog just yet, streamers are continuing to offer a healthy slate of decidedly non-festive content in the run-up to the big day.\r\n\r\nLeading the charge this week is Barbie on Max, Greta Gerwig’s industry-shaking fantasy comedy, and Chicken Run: Dawn of the Nugget, a long-awaited Netflix sequel to Aardman’s 2000 stop-motion classic. Netflix subscribers can also enjoy the second half of The Crown’s sixth and final season, while Reacher season 2 begins streaming on Prime Video.\r\n\r\nIt’s the final weekend before Christmas (yay!), but if you’re not ready to crack open the eggnog just yet, streamers are continuing to offer a healthy slate of decidedly non-festive content in the run-up to the big day.\r\n\r\nLeading the charge this week is Barbie on Max, Greta Gerwig’s industry-shaking fantasy comedy, and Chicken Run: Dawn of the Nugget, a long-awaited Netflix sequel to Aardman’s 2000 stop-motion classic. Netflix subscribers can also enjoy the second half of The Crown’s sixth and final season, while Reacher season 2 begins streaming on Prime Video.', '', 'restricted_html'),
('blog', 0, 2, 16, 'en', 0, 'This is not a drill: Barbie – the highest-grossing movie of 2023 and the most successful Warner Bros. movie of all time – is now streaming on Max. \r\n\r\nIf you somehow managed to miss the wall-to-wall coverage of Greta Gerwig\'s subversive satire over summer, this star-studded picture centers on an inquisitive Barbie doll (played by Margot Robbie) whose colorful and seemingly perfect existence is called into question following a trip to the (decidedly less perfect) real world. Ryan Gosling stars alongside Robbie as Ken, with Will Ferrell, Kate McKinnon, America Ferrera, Simu Liu, Emma Mackey and many, many more A-listers among the film\'s supporting cast.\r\n\r\nSuffice to say, this is a big deal for Max subscribers, whose library of best Max movies just got an envy-inducing upgrade. If you\'re in the UK viewers, you\'ll have to wait a little longer to stream Barbie from the comfort of your own Mojo Dojo Casa House, but we\'d expect to see the movie added to Sky Cinema soon.\r\n\r\nNow available to stream on Max.', '', 'restricted_html'),
('blog', 0, 3, 9, 'en', 0, '<p>This is not a drill: <em>Barbie</em> – the highest-grossing movie of 2023 and the most successful Warner Bros. movie of all time – is now streaming on Max.&nbsp;</p><p>If you somehow managed to miss the wall-to-wall coverage of Greta Gerwig\'s subversive satire over summer, this star-studded picture centers on an inquisitive Barbie doll (played by Margot Robbie) whose colorful and seemingly perfect existence is called into question following a trip to the (decidedly less perfect) real world. Ryan Gosling stars alongside Robbie as Ken, with Will Ferrell, Kate McKinnon, America Ferrera, Simu Liu, Emma Mackey and many, many more A-listers among the film\'s supporting cast.</p><p>Suffice to say, this is a big deal for Max subscribers, whose library of&nbsp;<a href=\"https://www.techradar.com/best/best-hbo-max-movies\">best Max movies</a>&nbsp;just got an envy-inducing upgrade. If you\'re in the UK viewers, you\'ll have to wait a little longer to stream <em>Barbie </em>from the comfort of your own Mojo Dojo Casa House, but we\'d expect to see the movie added to Sky Cinema soon.</p><p><em>Now available to stream on Max.</em></p><p>&nbsp;</p><p>This is not a drill: <em>Barbie</em> – the highest-grossing movie of 2023 and the most successful Warner Bros. movie of all time – is now streaming on Max.&nbsp;</p><p>If you somehow managed to miss the wall-to-wall coverage of Greta Gerwig\'s subversive satire over summer, this star-studded picture centers on an inquisitive Barbie doll (played by Margot Robbie) whose colorful and seemingly perfect existence is called into question following a trip to the (decidedly less perfect) real world. Ryan Gosling stars alongside Robbie as Ken, with Will Ferrell, Kate McKinnon, America Ferrera, Simu Liu, Emma Mackey and many, many more A-listers among the film\'s supporting cast.</p><p>Suffice to say, this is a big deal for Max subscribers, whose library of&nbsp;<a href=\"https://www.techradar.com/best/best-hbo-max-movies\">best Max movies</a>&nbsp;just got an envy-inducing upgrade. If you\'re in the UK viewers, you\'ll have to wait a little longer to stream <em>Barbie </em>from the comfort of your own Mojo Dojo Casa House, but we\'d expect to see the movie added to Sky Cinema soon.</p><p><em>Now available to stream on Max.</em></p>', 'This is not a drill: Barbie – the highest-grossing movie of 2023 and the most successful Warner Bros. movie of all time – is now streaming on Max. ', 'basic_html'),
